function sleep (ms) {
	return new Promise (resolve => setTimeout (resolve, ms));
}
export function GetPrediction (model, sample)
{
	if (model == null)
		return -1;
	if (sample == null)
		return -2;

	setTimeout (() => { return Math.round (Math.random() * 100) / 100; }, 0);
}
